import React, { Component } from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
//import axios from "axios";
import { Link, withRouter } from "react-router-dom";
import { Camera } from "expo-camera";
import * as ImagePicker from "expo-image-picker";
import ShootingStyle from "./styles/ShootingStyle.js";

import facescan from "../../assets/image/face-scan.png";

class Shooting extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedFile: null,
      isOpenCamera: false,
    };
  }

  handleImageUpload = (event) => {
    this.setState({ selectedFile: event.target.files[0], isOpenCamera: false });
  };

  _handleOpenCamera = () => { };

  handleStartTesting = () => {
    const { history } = this.props;
    const { selectedFile } = this.state;

    if (!selectedFile) {
      alert("Please upload an image before testing.");
      return;
    }

    const formData = new FormData();
    formData.append("image", selectedFile);

    //   axios
    //     .post("http://localhost:5000/process", formData)
    //     .then((response) => {
    //       let result = response.data.predicted_class;
    //       const imageUrl = URL.createObjectURL(selectedFile);

    //       // Chia kết quả thành hai biến state
    //       this.setState({
    //         predictedLabel: result,
    //         imageUrl: imageUrl,
    //       });
    //       history.push({
    //         pathname: "/result",
    //         state: { imageUrl: imageUrl, result: result },
    //       });
    //     })
    //     .catch((error) => {
    //       console.log(error);
    //     });
    // };
    history.push("/result");
  };

  _handleToggleCamera = () => {
    this.setState((prev) => {
      return { ...prev, isOpenCamera: !prev.isOpenCamera };
    });
  };

  _handleTakePhoto = async () => {
    if (this.camera) {
      let photo = await this.camera.takePictureAsync();
      this.setState({
        selectedFile: photo.uri,
        isOpenCamera: false,
      });
    }
  };

  _handleChooseFromGallery = async () => {
    let result = await ImagePicker.launchImageLibraryAsync({
      mediaTypes: ImagePicker.MediaTypeOptions.Images,
      allowsEditing: true,
      aspect: [4, 3],
      quality: 1,
    });

    if (!result.cancelled) {
      this.setState({
        selectedFile: result.uri,
        isOpenCamera: false,
      });
    }
  };

  render() {
    return (
      <View style={ShootingStyle.container}>
        <View style={ShootingStyle.topinfo}>
          <View style={ShootingStyle.row}>
            <View style={ShootingStyle.backmenu}>
              <TouchableOpacity onPress={() => this.props.history.push("/")}>
                <View style={ShootingStyle.rectangle}>
                  <Text style={ShootingStyle.icon}>
                    <i className="bx bxs-home"></i>
                  </Text>
                </View>
              </TouchableOpacity>
            </View>
          </View>
          <View style={ShootingStyle.mainphoto}>
            <View style={ShootingStyle.content}>
              <View style={ShootingStyle.elipse2}>
                <View style={ShootingStyle.elipse}>
                  {this.state.isOpenCamera ? (
                    <Camera
                      style={ShootingStyle.camera}
                      type={Camera.Constants.Type.front}
                      ref={(ref) => {
                        this.camera = ref;
                      }}>
                      <TouchableOpacity
                        onPress={this._handleTakePhoto}
                        style={ShootingStyle.captureButton}>
                        <Text style={ShootingStyle.captureButtonText}>
                          Capture photo
                        </Text>
                      </TouchableOpacity>
                    </Camera>
                  ) : this.state.selectedFile ? (
                    <Image
                      source={{ uri: this.state.selectedFile }}
                      style={ShootingStyle.selectedImage}
                    />
                  ) : (
                    <Image source={facescan} style={ShootingStyle.defaultImage} />
                  )}
                </View>
              </View>
            </View>
          </View>
        </View>
        <View style={ShootingStyle.bottominfo}>
          <View style={ShootingStyle.buttonmenu}>
            <View style={ShootingStyle.upload}>
              <TouchableOpacity
                onPress={this._handleToggleCamera}
                style={ShootingStyle.rectangle}>
                <Text style={ShootingStyle.icon}>
                  <i className="bx bxs-camera"></i>
                </Text>
              </TouchableOpacity>
              <TouchableOpacity
                onPress={this._handleChooseFromGallery}
                style={ShootingStyle.imageLabel}>
                <Text style={ShootingStyle.icon}>
                  <i className="bx bxs-image"></i>
                </Text>
              </TouchableOpacity>
            </View>
            <View style={ShootingStyle.test}>
              <TouchableOpacity
                onPress={this.handleStartTesting}
                style={ShootingStyle.rectangle}>
                <Text style={ShootingStyle.testText}>Start Testing</Text>
              </TouchableOpacity>
            </View>
          </View>
        </View>
      </View>
    );
  }
}

export default withRouter(Shooting);
